import './InfoCell.css';

const InfoCell = () => {
  return(
    <div className='infoOuterContainer'>
      <div className='textContainer'>
        <div className='cellTitleText'>
          About Me
        </div>
        <div className='cellContentText'>
          I grew up in a bed and breakfast on lake Superior, and I learned the code of many things there. I learned the code of music by studying the violin, which I still play. I learned the code of language with a voracious appetite for reading. I discovered the code of color, line and form in our neighbours home, who were sculptors and painters by trade. In high school I learned the programming language of the TI-83 graphing calculator to make games and pattern generators. In college I was shown the code of our mass media and the flow of information. After college I discovered Arduino micro-controllers, and self-learned a dialect of C++ to create reactive light fixtures, expressive clothing, and other devices. I knew for a long time that software engineering was calling to me, but life was full and busy, and it was easy to drown it out.  I finally took a leap of faith last year, and left my job for a full-time full stack bootcamp. I had taken a few coding courses online in the past, but this was 40+ hours a week, and I was immersed. Javascript, python, SQL, React, data structures and algorithms, these became my life.
        </div>
      </div>
      <div className='photoContainer'>
      </div>
    </div>
  )
};

export default InfoCell;
